import torch
import torch.nn as nn
from torch.utils.cpp_extension import load_inline

# Define the custom CUDA kernel for matrix multiplication
matmul_source = """
#include <torch/extension.h>
#include <cuda_runtime.h>
#include <cublas_v2.h>

torch::Tensor matmul_cuda(torch::Tensor A, torch::Tensor B) {
    // Get dimensions
    int M = A.size(0);
    int K = A.size(1);
    int N = B.size(1);

    // Create output tensor
    auto options = torch::TensorOptions().device(torch::kCUDA).dtype(A.dtype());
    auto C = torch::empty({M, N}, options);

    // Get pointers to tensor data
    float* a_data = A.data_ptr<float>();
    float* b_data = B.data_ptr<float>();
    float* c_data = C.data_ptr<float>();

    // Create cublas handle
    cublasHandle_t handle;
    cublasCreate(&handle);

    // Perform matrix multiplication using cublas
    // C = alpha*A*B + beta*C
    float alpha = 1.0f;
    float beta = 0.0f;

    // Note: cuBLAS uses column-major ordering, but PyTorch uses row-major
    // So we compute B^T * A^T = (A * B)^T and then take transpose
    cublasSgemm(handle, 
                CUBLAS_OP_N, CUBLAS_OP_N,
                N, M, K,
                &alpha,
                b_data, N,
                a_data, K,
                &beta,
                c_data, N);

    // Destroy the handle
    cublasDestroy(handle);

    return C;
}
"""

matmul_cpp_source = """
torch::Tensor matmul_cuda(torch::Tensor A, torch::Tensor B);
"""

# Compile the inline CUDA code for matrix multiplication
matmul_module = load_inline(
    name="matmul_custom",
    cpp_sources=matmul_cpp_source,
    cuda_sources=matmul_source,
    functions=["matmul_cuda"],
    verbose=True,
    extra_ldflags=["-lcublas"],
)

class ModelNew(nn.Module):
    """
    Optimized model that performs a single matrix multiplication (C = A * B) with a large K dimension
    using a custom CUDA kernel with cuBLAS
    """
    def __init__(self):
        super(ModelNew, self).__init__()
        self.matmul_module = matmul_module

    def forward(self, A: torch.Tensor, B: torch.Tensor) -> torch.Tensor:
        """
        Performs matrix multiplication of A and B using a custom CUDA kernel.

        Args:
            A: Input tensor of shape (M, K)
            B: Input tensor of shape (K, N)

        Returns:
            Output tensor of shape (M, N)
        """
        # Make sure inputs are on GPU
        A = A.cuda()
        B = B.cuda()
        return self.matmul_module.matmul_cuda(A, B)
